    [],nt"num_tags": 10,nt"name": "kodiak-national-wildlife-refuge-annual-narrative-report-calendar-year-1985",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Kodiak
    NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include fire management, pest control, and water rights.
    The wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, marine mammals, fisheries resources, and marking
    and bird banding. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment replacement, and computer systems. Cooperative
    programs, economic uses of the Refuge, and items of interest are provided at the
    end. Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
